(function () {
    BizwebThemes.theme = function () {
        function theme(params) {
            this.params = {};
            this.params.currentThemeListIndex = 1;
            this.params.isLoadMoreTheme = false;
            this.params.totalThemePage = params.total_theme_page;
            this.params.getLinkTheme=params.get_link_theme;
            this._bindListThemeEvent();
        }

        theme.prototype._bindListThemeEvent = function () {
            var params=this.params;
            $('.btnLoad').click(function () {
                var $this = $(this);
                if (!params.isLoadMoreTheme && params.currentThemeListIndex < params.totalThemePage)
                {
                    params.isLoadMoreTheme = true;
                    $(document).find('#themes_list_container').append('<div id="list_loading" style="padding: 20px;text-align: center;font-size: 30px;"><i class="fa fa-spinner fa-pulse"></i></div>')
                    var price = $('#dvPrice a.active').attr('val');
                    var collectionId = $("#CollectionId").val();
                    //var featureId = $("#FeatureId").val();
                    var sortId = $("#SortId").val();
                    ////console.log(sortId);
                    var query = $("#search").val();
                    //var search = $("#search").val();
                    setTimeout(function () {
                        $.ajax({
                            url: params.getLinkTheme,
                            data: {
                                page: params.currentThemeListIndex + 1,
                                collection : collectionId,
                                sort : sortId,
                                query : query,
                                price : price
                            },
                            success: function (data) {
                                console.log(data.themes)
                                if (data && data.themes) {
                                    var template = $('#themes-list-template').html();
                                    var rendered = Mustache.render(template, { "themes": data.themes });
                                    $(document).find('#themes_list_container').find('#list_loading').remove();
                                    $(document).find('#themes_list_container').append(rendered);
                                    Twine.bind($this.get(0));
                                    params.currentThemeListIndex++;
                                    if(params.currentThemeListIndex==params.totalThemePage)
                                    {
                                        $this.hide();
                                    }
                                }
                                params.isLoadMoreTheme = false;
                            }
                        })
                    },200);
                }
                else {
                    $this.hide();
                }
            })
        }

        return theme;
    }();
}).call(this);